import React from 'react';

import SiteNavbar from './SiteNavbar';

import TeamPhotoBig from '../img/teamPhotoBig.png';

import '../css/Join.css';

const Join = () => {
	return (
		<div>
			<SiteNavbar />
			<img src={TeamPhotoBig} alt="team big" className="team-photo" />
			<h3>
				We are not currently accepting applications. Check back in Fall 2020!
			</h3>
		</div>
	);
};

export default Join;
